		//String page = "kTrying to explain the doctrine of the Trinity to readers of The New Republic is not easyccOn June 2, 1944, W.H. Auden penned that sentence in a letter to Ursula Niebuhr. On January 26, 2010, Andrew Sullivan posted it as the kquote for the dayccon his blog. Displaced and unglossed quotations are always in some way mordant, and brccccistle smugly with implications. Let us see what this one implies.1Auden was at Swarthmore when he wrote his letter to his friend. He began by thanking her for her admiration of a piece about Kierkegaardccs Either/Or that he had recently published in The New Republic, and then reported that he had just finished, kafter writing it four times,cca review for the magazine of Charles Norris Cochraneccs book Christianity and Classical Culture, which had in fact appeared four years earlier. His trouble in completing the piece to his satisfaction was what prompted the remark that Sullivan finds so pleasing and repercussive. Audenccs intense and idiosyncratic theology was flourishing in those years, not least owing to the impact upon his thinking of the friendship and the teaching of Reinhold Niebuhr, Ursulaccs very remarkable husband. The Cochrane piece, which barely mentions Cochrane at all, is a fine example of Auden at his most philosophically grandiose and amateurish. kThe distinctive mark of classical thought is that it gives no positive value to freedom and identifies the divine with the necessary or the legal kA monolithic monotheism is always a doctrine of God as either manic-depressive Power or schizophrenic Truth.cccccccc And so on. On metaphysical themes, Audenccs original formulations could sometimes be very obscure. Perhaps that was why my predecessor at this magazine held the article for many months, until late September. kAt last, The New Republic has printed my now monthscc old piece on Cochraneccs book,ccAuden wrote to Ursula in October, kâ€”theyccve cut it about a bit but Iccm really quite pleased with it.cc1The striking thing about Audenccs discussion of the Trinity in his piece is that, notwithstanding his complaint about the difficulty of explaining it, he fails to explain it. Instead he concedes that it is inexplicable. kThe formula,cche declares, is ka foolishness to the reason,ccbecause reason is convinced only kby logical necessity, like the timeless truths of geometry,ccand so could not kgrasp â€¦ the doctrine of three personsccin God. Auden is not be chided for his failure. He followed in a long line of Christian intellectuals who despaired of explanations for this belief. That line included some of the greatest thinkers in the Christian tradition. Augustine, whose treatment of the Trinity was discussed by Cochrane in his book and by Auden in his review, began his influential treatise on the subject by declaring that the aim of his work was kto guard against the sophistries of those who disdain to begin with faith and are deceived by a crude and perverse love of reason.cc Aquinas, in the first part of the Summa Theologica, was more direct: kIt is impossible to attain to the knowledge of the Trinity by natural reasonccFor this reason, he asserted, kwe must not attempt to prove what is of faith, except by authority alone, to those who receive the authority; while as regards others, it suffices to prove that what faith teaches is not impossibleccIndeed, the despair of explanation goes all the way back to the Fathers of the Church, who afflicted themselves with the most extraordinary mental contortionsâ€“hypostasis, ousia, and the restâ€“to make the idea of the Trinity seem plausible. They were right, finally, to call it a mystery. To regard a concept as a mystery may be a spiritual triumph, but it is an intellectual defeat.1I wish to confirm Audenccsâ€“and Sullivanccsâ€“suspicion that New Republic people cannot comprehend the Trinity; or at least those New Republic people who are not (in Aquinasccs terms) among kthose who receive the authority,ccbut are the logically minded kothers; or at least this New Republic person. The idea of plurality in the deity, like the idea of corporeality in the deity (Auden would not have had an easier time with the Incarnation!), represents nothing less than a retraction of the monotheistic revolution in thinking about God, a reversal of Godccs sublimity, a regress to polytheistic crudity. It is completely inconsistent with everything that my mind instructs me to believe about Godccs essence. (I leave aside what my mind instructs me to believe about Godccs existence. We are in the realm of theology here, not the realm of philosophy.)1Of course, my stiff-necked opinion about this central tenet of the Christian faith is not only rational, it is also Jewish. The electrifying history of Jewish-Christian disputations in the Middle Ages amply documents the scrupulously argued Jewish refusal to entertain anything but a perfect unity in the conception of God. In the words of an early modern Jewish writer, whose polemical work survives in an unattributed Hebrew manuscript at the Jewish Theological Seminary, kI do not understand this and you will not be able to explain it to meccThat is not a report of a prejudice. It is a report of a view with rationally defensible grounds. The respect one must have for believers one need not have for beliefs.1When Auden joked to Niebuhr that the Trinity could hardly be understood in The New Republic, he was lightly lamenting the spiritual shallowness of the liberalism of his day. He was not alone in this lament, to be sure. The 1940s were the years of the inner deepening of American liberalism, under the influence of Niebuhr, and Schlesinger, and Trilling. Perhaps Sullivan is posting his kquote for the dayccto make the same pointâ€“except that in his present incarnation he is himself a bizarre kind of liberal, and The New Republic today, a liberal magazine, is not known only, or in some quarters mainly, for its liberalism. It is hard to escape the impression that Sullivan is not liberal-baiting here. No, when he piously implies that the orbit of The New Republic is immune, or hostile, to the eternal verities of Christianity, he is baiting another class of people, and operating in the vicinity of a different canard.1Â 1II.1Consider some squibs that Sullivan recently posted on his blog. kMost American Jews, of course, retain a respect for learning, compassion for the other, and support for minorities (Jews, for example, are the ethnic group most sympathetic to gay rights),cche declared on January 13. kBut the Goldfarb-Krauthammer wingâ€“that celebrates and believes in government torture, endorses the pulverization of Gazans with glee, and wants to attack Iranâ€“is something else. Something much darkerccMichael Goldfarb is the former online editor of The Weekly Standard, about whom the less said, the better. Charles Krauthammer is Charles Krauthammer. I was not aware that they comprise a kwingccof American Jewry, or that American Jewry has kwingsccWhat sets them apart from their more enlightened brethren is the unacceptability of their politics to Sullivan. That is his criterion for dividing the American Jewish community into good Jews and bad Jewsâ€“a practice with a sordid history.1As far as I can tell, Krauthammerccs position on torture is owed to a deep and sometimes frantic concern for American security, and his position on the war in Gaza to a deep and sometimes frantic concern for Israeli security, and his position on Iran to a deep and sometime frantic concern for American and Israeli security. Whatever the merits of his views, I do not see that his motives are despicable. Moreover, Krauthammer argues for his views; the premises of his analysis are coldly clear, and may be engaged analytically, and when necessary refuted. Unlike Sullivan, he does not present feelings as ideas. Most important, the grounds of Krauthammerccs opinions are no more to be found in, or reduced to, his Jewishness than the grounds of the contrary opinionsâ€“the contentions of dovish Jews who denounce torture, and oppose Israeli abuses in the Gaza war, and insist upon a diplomatic solution to the threat of an Iranian nuclear capabilityâ€“are to be found in, or reduced to, their Jewishness. All these kwingsccare fervent Jews and friends of Israel. There are many kJewishccanswers to these questions. We all want the Torah on our side. And the truth is that the Torah has almost nothing to do with it.1Sullivan is hunting for motives, not reasons; for conspiracies, which is the surest sign of a mindccs bankruptcy. These days the self-congratulatory motto above his blog is kOf No Party or Clique,ccbut in fact Sullivan belongs to the party of Mearsheimer and the clique of Walt (whom he cites frequently and deferentially), to the herd of fearless dissidents who proclaim in all seriousness, without in any way being haunted by the history of such an idea, that Jews control Washington. Sullivan might have a look at the domestic pressuresâ€“in lobbies and other formsâ€“upon American diplomacy toward China, Saudi Arabia, Turkey, and Cuba, and give a thought or two to the elaborate and sometimes exasperating nature of foreign-policy-making in a democracy; but he prefers not to dive deep into the substance of anything. It is less immediately satisfying than cursing and linking. Does Sullivan think that Obamaccs engagement with Iranâ€“which, accurately described, is an engagement with the Iranian dictatorship and not with the Iranian peopleâ€“is paying off? Does he believe that the Israeli war against Hamas was an unjust war, or that Israel should have continued to absorb Hamasccs rocket attacksâ€“which were indisputably criminalâ€“and not acted with force against them? His answers may be inferred from his various ejaculationsâ€“kthe pulverization of Gazans,ccfor example, is a phrase that is calculatedly indifferent to the wrenching moral and strategic perplexities that are contained in the awful reality of asymmetrical warfareâ€“but they are not so much answers as bar-room retorts; moody explosions of verbal violence; more invective from another American crank. Worst of all, the explanation that Sullivan adopts for almost everything that he does not like about Americaccs foreign policy, and Americaccs wars, and Americaccs role in the worldâ€“that it is all the result of the clandestine and cunningly organized power of a single and small ethnic groupâ€“has a provenance that should disgust all thinking people.1And this is not all that is disgusting about Sullivanccs approach. His assumption, in his outburst about kthe Goldfarb-Krauthammer wing,ccthat every thought that a Jew thinks is a Jewish thought is an anti-Semitic assumption, and a rather classical one. Bigotry has always made representatives of individuals, and discerned the voice of the group in the voice of every one of its members. Is everything that every gay man says a gay statement? I will give an example. On October 15, 2001, when the ruins of the World Trade Center still smoldered, Sullivan published a piece in the Times of London called kA British View of the US Post-September 11ccIn this piece he accused Bill Clinton of kappeasement,ccand praised George W. Bush for assembling kthe ideal teamccfor a ktaskccthat kcannot be done by airpower alone,ccand had kind words for Americaccs kworld hegemonyccâ€“the politics changes, the fever remains the sameâ€“and also included this unforgettable sentence: kThe decadent Left in its enclaves on the coasts is not dead â€“ and may well mount what amounts to a fifth columnccA fifth column! It is a genuinely sinister sentence. I wish to emphasize two features of Sullivanccs Â comment. The first is that it is an exercise in demonization: it divides the American people into good Americans and bad Americans. The second is that it is in no way an expression of Sullivanccs homosexuality. It must never be said that when Sullivan lauded the bellicosity of Cheney and Rumsfeldâ€“which wing of American Christianity, by the way, shall we blame for them? â€“he exchanged the company of the good gays for the company of the bad gays. To say that would be homophobic. Here is what such homophobia would look like: Most American homosexuals, of course, retain a respect for art, and compassion for the other, and support for minorities. But the Sullivan-Shmullivan wing of American homosexualityâ€“that celebrates and believes in torture and war, and endorses the pulverization of Afghan villages with glee, and wants to attack any country where Al Qaeda may be foundâ€“is something else. Something much darker. Get it?1Â 1III.1A day later, on January 14, Sullivan permitted himself another thought on Israel. This is the whole of it:1kThe Netanyahu government has all but declared war on the Obama administration and then openly disses a vital ally, Turkey. The slow cultural shifts in Israelâ€“toward ever more arrogance, more fundamentalism, more Russian immigrant racism, contempt for the Muslim world, military adventurism, and the daily grinding of the Palestinians on the West Bank and pulverization and inhumane blockade of the people of Gazaâ€“well maybe others can explain it. All I can say is: it saddens me, as a longtime lover of the Jewish state. It does not represent the historic mainstream of liberal Jewish society, it is a betrayal of many Jewish virtues that goyim like me deeply admire, and it seems designed for war as some kind of eternal and uplifting state of mind. I hope Israel shifts soon. For Israelccs sake.cc1That bit about Sullivanccs love for the Jewish state is poignant, and on behalf of all the good Jews in America I thank him for it, but I am unmoved. This squib is an anthology of banalities and stereotypes. The karroganceccof Israelis: they are pushy, arencct they? And the slippery slope from pushiness in Tel Aviv to inhumanity in Jabaliya: it is obvious, isncct it? Â kMore fundamentalism,ccSullivan says, but there is no such thing as Jewish fundamentalism, and there has been no such thing as Jewish fundamentalism since early Karaism. (He can Google it.) The settlers on the West Bank and the religious fascists in their midst are not fundamentalists. They represent a particular school of interpretation of scriptural and rabbinical authoritiesâ€“a debatable one and a deplorable one. But they are not fundamentalists. kMore Russian immigrant racismcc: it is a problem, though in this region there is a lot of xenophobia to go around, which brings us to kcontempt for the Muslim worldccFor the entirety of the Muslim world, by the entirety of Israeli society? I think not. And does Sullivan have any notion of the magnitude and the virulence of Muslim contempt for the Jewish world? Muslim contempt for Jews does not justify Jewish contempt for Muslims, of course; but nothing justifies Sullivanccs refusal to give the whole picture. kMilitary adventurismcc: about the wars against Hamas and Hezbollah this is an empty and propagandistic phrase. Whatever went awry in those campaigns, and many Israelis and supporters of Israel were quick to condemn it, they were hardly adventuresâ€“unless you believe that the lives of Israelis under attack do not have the same moral import as the lives of Arabs under attack, which is what Sullivanccs malicious epithet suggests. It does not answer the question of whether those wars of retaliation were just wars, it simply dismisses the question. Here, too, Sullivan refuses to give the whole picture. kThe daily grinding of the Palestinians on the West Bankcc: I was in Ramallah recently, and the situation is more complex and even more hopeful. Anyway, the only thing that will save the Palestinians from the occupationâ€“and a less terrible occupation is still an occupation, which is terribleâ€“is political compromise. With the exception of Salam Fayyad and Mahmoud Abbas on his good days, I do not see a Palestinian keenness for compromise. Again, this does not justify the Israeli lack of the same keenness; but